import { useState } from "react";
import Login from "./Login";
import Signup from "./Signup";

function LoginSignup(){
    const [showLogin, setShowLogin] = useState(false)

    return(
        <>
            <h1>LoginSignup Page!!</h1>
            {showLogin ? 
            (
                <>
                <p> Log in page</p>
                < Login />
                </>
            )
            :
            (
                <>
                <p> Signup page</p>
                <Signup />
                </>
            )

            }
        </>

    )
};

export default LoginSignup;



